import React from 'react';
import styles from '../css/Skills.module.css'; // Updated import

const skills = [
    'PHP', '(CSS)', '(SEO)', '(AWS)', 'HTML', 'Linux', 'MySQL', 'Apache', 'cPanel', 'Plesk',
    'Ansible', 'Python', 'WordPress', 'phpMyAdmin', 'E-commerce', 'Web Design', 'Data Science',
    'Linux Admin', 'Social Media', 'Web Analytics', 'Online Marketing', 'Online Advertising',
    'Data Analytics', 'Digital Marketing', 'Social Networking', 'Bash Scripting'
];

const Skills = () => {
    return (
        <div className={styles.skills}> {/* Use styles.skills instead of "skills" */}
            <h1><u>Skills</u></h1>
            <div className={styles.skillsGrid}> {/* Use styles.skillsGrid instead of "skills-grid" */}
                {skills.map((skill, index) => (
                    <div key={index} className={styles.skillBubble}> {/* Use styles.skillBubble instead of "skill-bubble" */}
                        {skill}
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Skills;
